export const saveUser = (userEmail) => {
	return dispatch => {
		dispatch(loginUser(userEmail));
	};
};
export const logoutUser = () => {
	return dispatch => {
		dispatch(logout);
	}
}
const loginUser = userEmail => ({
	type: 'LOGIN_USER',
	payload: userEmail,
});
const logout = () => ({
	type: 'LOGOUT_USER',
});

const signOut = () => ({
	type: 'IS_REGISTERED'
})
